function PokeCard(props) {
    console.log(props.data.pokedex_id);
    const pokeNumber = props.data.pokedex_id;
    const formattedPokeNumber = pokeNumber.padStart(3, "0");
    console.log(formattedPokeNumber);

    return(
        <div className="bg-slate-300 px-10 py-5">
            {props.data && (
                <>
                    <img 
                        className="size-24"
                        src={props.data.sprites.regular} 
                        alt={props.data.name.fr} 
                    />
                    <div>
                        <h3>{props.data.name.fr}</h3>
                        {/* <p>#{pokeNumber}</p> */}
                    </div>
                </>
            )} 
        </div>
    )
}

export default PokeCard;
